import React from 'react';
import map from "/website//map.png"

const Infernoguard = () => {
  return (
    <div>
      <h1>Paid Data science Internship</h1>
      <img style={{border: "5px solid #555", margin: 10, width: "200px", height: "200px", textAlign: "left"}} src={map} alt="logo" />
      <>
      As part of the two person risk assesment model development team, I work on the backend. I have set up the AWS environment for running the model based on spacial input. I have written code to convert point data to geographical representation for the arc.js frontend developer. This will inform a client about the areas of greatest fire risk on their property.
      The core of the model comes from environmental science research involing the effects of weather (temperature, humidity), Vegitation/Moisture indexs (NDMI, NDVI), etc. Currently I am organizing a database of historical entries for the United States to improve the model's runtime.
      </>
    </div>
  );
};

export default Infernoguard;
